import React, { useContext, useEffect } from 'react'
import { useNavigate, useParams } from 'react-router-dom'
import { BookContext } from '../cAPI'
import BookFinder from '../Apis/BookFinder'

const BookDetail = (props) => {
  const {isbn} = useParams()
  const {selectedBook, setSelectetBook} = useContext(BookContext)
  const navigate = useNavigate()

  console.log (isbn);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await BookFinder.get(`/${isbn}`);
                setSelectetBook(response.data.data.books)
                console.log(response.data.data.books);
            } catch (err) {
                console.log(err);
            }
        }
        fetchData();
    },[])



        
    

    const handleDelete = async (e, isbn) => {
        e.stopPropagation();
        try {
            const response = await BookFinder.delete(`/${isbn}`);
            console.log(response);
            navigate(`/`)
        } catch (err) {
            console.log(err);
        }
    }

    if (selectedBook){
        const handleDelete = async (e, isbn) => {
            e.stopPropagation();
            try {
                const response = await BookFinder.delete(`/${isbn}`);
                console.log(response);
                navigate(`/`)
            } catch (err) {
                console.log(err);
            }
        }

        return (
            <div className="list-group">                
                <form>
                    <div class="mb-3" className="form-group">
                        <label htmlFor="isbn">ISBN</label>
                        <input class="form-control" type="text" value={selectedBook.isbn} disabled readonly />
                    </div>

                    <div class="mb-3" className="form-group">
                        <label htmlFor="title">Title</label>
                        <input class="form-control" type="text" value={selectedBook.title} disabled readonly></input>
                    </div>

                    <div class="mb-3" className="form-group">
                        <label htmlFor="author">Author</label>
                        <input class="form-control" type="text" value={selectedBook.author} disabled readonly></input>
                    </div>

                    <div class="mb-3" className="form-group">
                        <label htmlFor="year">Year</label>
                        <input class="form-control" type="text" value={selectedBook.year} disabled readonly></input>
                    </div>

                    <div class="mb-3" >
                        <label htmlFor="publisher">Publisher</label>
                        <input class="form-control" type="text" value={selectedBook.publisher} disabled readonly></input>
                    </div>

                    <div class="mb-3">
                        <label class="col-sm-2 col-form-label" for="language">Langueage</label>
                        <div class="col-sm-10">
                            <input class="form-control" type="text" value={selectedBook.language} disabled readonly></input>
                        </div>
                    </div>

                    <div class="row mb-3">
                        <label class="col-sm-2 col-form-label" for="translation">Translation</label>
                        <div class="col-sm-10">
                            <input class="form-control" type="text" value={selectedBook.translation} disabled readonly></input>
                        </div>
                    </div>

                    <div class="row mb-3">
                        <label class="col-sm-2 col-form-label" for="tags">Tags</label>
                        <div class="col-sm-10">
                            <input class="form-control" type="text" value={selectedBook.tags} disabled readonly></input>
                        </div>
                    </div>

                    <div class="row">
                        <div class="col">
                            <button type="button" onClick={(e) => { e.stopPropagation(), navigate(`/`) } } className="btn btn-primary">Back</button>
                        </div>
                        <div class="col">
                        <button type="button" onClick={(e) => { e.stopPropagation(), navigate(`/${selectedBook.isbn}/update`) } } className="btn btn-warning">Update</button>
                        </div>
                        <div class="col">
                        <button type="button" onClick={(e) => handleDelete(e, selectedBook.isbn)} className="btn btn-danger">Delete</button>
                        </div>
                    </div>
                </form>
            </div>
    )
    }else{
        navigate(`/`)  
    }
}

export default BookDetail

